import{_ as a,c as p,o as t,a1 as m}from"./chunks/framework.Dtqp5x_0.js";const f=JSON.parse('{"title":"注册成员","description":"","frontmatter":{},"headers":[],"relativePath":"cooperationMember.md","filePath":"cooperationMember.md"}'),e={name:"cooperationMember.md"},i=m('<h1 id="注册成员" tabindex="-1">注册成员 <a class="header-anchor" href="#注册成员" aria-label="Permalink to &quot;注册成员&quot;">​</a></h1><h2 id="主要成员" tabindex="-1">主要成员 <a class="header-anchor" href="#主要成员" aria-label="Permalink to &quot;主要成员&quot;">​</a></h2><p>​ ​ 合作社的主要注册用户为葛青云、陈迺群、耿喜余、王战利、李楠楠、王娟、牛园园, 其中葛青云为社长。</p><h2 id="主要成员职责" tabindex="-1">主要成员职责 <a class="header-anchor" href="#主要成员职责" aria-label="Permalink to &quot;主要成员职责&quot;">​</a></h2><p>葛青云：社长，负责管理合作社的运营，包括制定规章制度、管理财务、协调成员工作等。</p><img src="https://thumbnail1.baidupcs.com/thumbnail/43435653fu0b09697e3e6e72174aa1b0?fid=3075988579-250528-615415955622077&amp;rt=pr&amp;sign=FDTAER-DCb740ccc5511e5e8fedcff06b081203-LMl7tbzg9mAdSHFtyi8Dfp2xwvA%3d&amp;expires=8h&amp;chkbd=0&amp;chkv=0&amp;dp-logid=9101968574320394839&amp;dp-callid=0&amp;time=1716469200&amp;size=c1440_u960&amp;quality=90&amp;vuk=3075988579&amp;ft=image&amp;autopolicy=1" alt="葛青云" style="width:100%;height:auto;"><p>陈迺群：副社长，负责管理合作社的财务，包括制定财务管理制度、审核财务报告、监督财务支出等。</p><img src="https://thumbnail1.baidupcs.com/thumbnail/7d2fbc02dl24a6d521afbb600672e747?fid=3075988579-250528-236755083967561&amp;rt=pr&amp;sign=FDTAER-DCb740ccc5511e5e8fedcff06b081203-YYSG5V%2fCPCBhzQiKI0a46wjPm%2fE%3d&amp;expires=8h&amp;chkbd=0&amp;chkv=0&amp;dp-logid=9101968574320394839&amp;dp-callid=0&amp;time=1716469200&amp;size=c1440_u960&amp;quality=90&amp;vuk=3075988579&amp;ft=image&amp;autopolicy=1" alt="陈迺群" style="width:100%;height:auto;"><p>耿喜余：副社长，负责管理合作社的成员，包括制定成员管理制度、审核成员申请、监督成员行为等。</p><img src="https://thumbnail1.baidupcs.com/thumbnail/9355b89a9u35b173738b7e653392adff?fid=3075988579-250528-1093963970781318&amp;rt=pr&amp;sign=FDTAER-DCb740ccc5511e5e8fedcff06b081203-a6JxKt%2b8hy5o54SqBZlJ4gcUajE%3d&amp;expires=8h&amp;chkbd=0&amp;chkv=0&amp;dp-logid=9101968574320394839&amp;dp-callid=0&amp;time=1716469200&amp;size=c1440_u960&amp;quality=90&amp;vuk=3075988579&amp;ft=image&amp;autopolicy=1" alt="耿喜余" style="width:100%;height:auto;"><p>王战利：副社长，负责管理合作社的物资，包括制定物资管理制度、审核物资申请、监督物资使用等。</p><img src="https://thumbnail1.baidupcs.com/thumbnail/9355b89a9u35b173738b7e653392adff?fid=3075988579-250528-1093963970781318&amp;rt=pr&amp;sign=FDTAER-DCb740ccc5511e5e8fedcff06b081203-a6JxKt%2b8hy5o54SqBZlJ4gcUajE%3d&amp;expires=8h&amp;chkbd=0&amp;chkv=0&amp;dp-logid=9101968574320394839&amp;dp-callid=0&amp;time=1716469200&amp;size=c1440_u960&amp;quality=90&amp;vuk=3075988579&amp;ft=image&amp;autopolicy=1" alt="王战利" style="width:100%;height:auto;"><p>李楠楠：副社长，负责管理合作社的设备，包括制定设备管理制度、审核设备申请、监督设备使用等。</p><img src="https://thumbnail1.baidupcs.com/thumbnail/11fa76457vd363d27081a70899bb8853?fid=3075988579-250528-471844868136055&amp;rt=pr&amp;sign=FDTAER-DCb740ccc5511e5e8fedcff06b081203-oCIgNp2Zuzp%2fYTGghTZTcMnNdDU%3d&amp;expires=8h&amp;chkbd=0&amp;chkv=0&amp;dp-logid=9101968574320394839&amp;dp-callid=0&amp;time=1716469200&amp;size=c1440_u960&amp;quality=90&amp;vuk=3075988579&amp;ft=image&amp;autopolicy=1" alt="李楠楠" style="width:100%;height:auto;"><p>王娟：副社长，负责管理合作社的成员活动，包括制定活动管理制度、审核活动申请、监督活动执行等。</p><img src="https://thumbnail1.baidupcs.com/thumbnail/4b0610da8h1bad5dcbff315f9b9468cf?fid=3075988579-250528-682183993525106&amp;rt=pr&amp;sign=FDTAER-DCb740ccc5511e5e8fedcff06b081203-EWnoTbY4c%2b5tt%2bEesGtFjP0O5qA%3d&amp;expires=8h&amp;chkbd=0&amp;chkv=0&amp;dp-logid=9101968574320394839&amp;dp-callid=0&amp;time=1716469200&amp;size=c1440_u960&amp;quality=90&amp;vuk=3075988579&amp;ft=image&amp;autopolicy=1" alt="王娟" style="width:100%;height:auto;"><p>牛园园：副社长，负责管理合作社的成员权益，包括制定权益管理制度、审核权益申请、监督权益处理等。</p><img src="https://thumbnail1.baidupcs.com/thumbnail/0c5ec152cgaeb26b3651e1b2192c23a1?fid=3075988579-250528-749441565185243&amp;rt=pr&amp;sign=FDTAER-DCb740ccc5511e5e8fedcff06b081203-y36ze4zpmdFgG2hErDVs1KrSMD0%3d&amp;expires=8h&amp;chkbd=0&amp;chkv=0&amp;dp-logid=9101968574320394839&amp;dp-callid=0&amp;time=1716469200&amp;size=c1440_u960&amp;quality=90&amp;vuk=3075988579&amp;ft=image&amp;autopolicy=1" alt="牛园园" style="width:100%;height:auto;"><h2 id="其他成员" tabindex="-1">其他成员 <a class="header-anchor" href="#其他成员" aria-label="Permalink to &quot;其他成员&quot;">​</a></h2><p>​ ​ 合作社迄今为止已带动农户28户,为这些农户提供了优秀的种植技术以及相关管理水平,并提供了相应的农资和农技服务。</p>',20),c=[i];function d(h,l,o,b,s,r){return t(),p("div",null,c)}const n=a(e,[["render",d]]);export{f as __pageData,n as default};
